import React from 'react';
import Header from './header'
import TableHolder from './TableHolder';
import DataBox from './dataBox';
import {atomicContext} from '../Contexts/atomicContexts'
function App(){
  return <div>
    <atomicContext>
      <Header/>
      <DataBox/>
      <TableHolder/>
    </atomicContext>
  </div>
};

export default App;
